import React from 'react'

export default function Form({ form }) {
    console.log(form);

    return (
        <div>
            <h4>{form.title}</h4>
            {form.map((i) => {
                return <div>
                    <div>{i.fields}</div>
                </div>
            })}
        </div>
    )
}
